def getstat(file,Name,stat):
    with open(file,'r') as rf:
        rf.seek(0)
        repeat=True
        while repeat==True:
            line=rf.readline()
            if Name in line and stat in line:
                line=line.split(',')
                value=int(line[2])
                repeat= False
                return value
            else:
                repeat=True
