def roll(d,n,add=0,adv=0,disadv=0):
    rolls=0
    result=[]
    for dice in range(d):
        roll=random.randint(1,n)
        result.append(roll)
        info.words=info.words+' roll d'+str(n)+' = '+str(roll)
    total = sum(result)
    if add==True:
        return total
    elif adv==True:
        return max(result)
    elif disadv==True:
        return min(result)
    else:
        return result[0]

def skillcheck(a,b):
    info.words=info.words+'\nattempting check at a DC: '+str(b)+' and mod +'+str(a)+' '
    value=roll(1,20)
    value=value+a
    if value<b:
        info.words=info.words+'\ncheck failed'
        return False
    else:
        info.words=info.words+'\ncheck passed'
        return True

