def terrainset():
    terrains=['desert', 'grasslands', 'forest', 'mountains','marshlands', 'hills', 'windy planes']
    newterrain=random.choice(terrains)
    return newterrain
def loot():
    loot=['a better weapon','a sheild','a lifestone']
    monloot=loot[random.randint(0,2)]
    info.words=info.words+'\nYou found '+monloot+' in the remains'
    if monloot=='a better weapon':
        player.weapon= player.weapon+1
    elif monloot=='a sheild':
        player.armor=player.armor+1
    elif monloot=='a lifestone':
        player.health=player.health+5
        info.words=info.words+'\nYou gained five health. you are now at '+str(player.health)
def fightprep():
    if info.fight==True and info.dead==False:
        if info.turn==0:
            if info.exp>=3:
                info.words=info.words+'\nThe dragon fights you!'
                enemy=dragon
            elif info.terrain=='desert':
                info.words=info.words+'\nThe worm fights you'
                enemy=worm
            elif info.terrain=='mountains':
                info.words=info.words+'\nThe yeti fights you'
                enemy=yeti
            elif info.terrain=='grasslands':
                info.words=info.words+'\nThe tigerbear fights you'
                enemy=tigerbear
            elif info.terrain=='forest':
                info.words=info.words+'\nThe troll fights you'
                enemy=troll
            elif info.terrain=='marshlands':
                info.words=info.words+'\nThe crocodile attacks you'
                enemy=crocodile
            elif info.terrain=='hills':
                info.words=info.words+'\nA goblin jumps out from behind a bush!'
                enemy=goblin
            elif info.terrain=='windy planes':
                info.words=info.words+'\nAn eagle swoops down from above!'
                enemy=eagle
            info.enemy=enemy
            info.monsterlife=enemy.health
            info.monsterarmor=enemy.armor
            info.monsterattack=enemy.attack
        if info.monsterlife>0 and info.run<5:
            info.words=info.words+'\nIt is your turn, do you attack or dodge?'
            info.b1words='attack'
            info.b2words='dodge'
            info.b1state='normal'
            info.b2state='normal'
            info.b3state='disabled'
def bclick(button):
    global textbox
    global playername
    info.words=''
    textbox['text']=''
    info.b1state='disabled'
    info.b2state='disabled'
    info.b3state='normal'
    if button==1:
        textbox['text']=''
        if info.dead==True:
            info.words='restarting game...\nClick next to begin.'
            info.dead=False
            restarting()
            screenwrite()
            return
        elif info.fight==True:
            info.turn=info.turn+1
            screenwrite()
            textbox['text']=''
            info.b1state='normal'
            info.b2state='normal'
            info.b3state='disabled'
            PlayerAttack=player.strength+player.weapon
            hit=skillcheck(PlayerAttack,info.monsterarmor)
            if hit==True:
                info.words=info.words+'\nYou hit the monster!'
                damage=(roll(1,6)+PlayerAttack)
                info.words=info.words+'\nYou dealt '+str(damage)+' damage!'
                info.monsterlife=info.monsterlife-damage
            else:
                info.words=info.words+'\nYou did not hit the monster.'
            PlayerArmor=player.armor
            if info.monsterlife>0:
                    info.words=info.words+'\nIt is the monster`s turn'
                    hit=skillcheck(info.monsterattack,PlayerArmor)
                    if hit==True:
                        info.words=info.words+'\nThe monster hit you'
                        damage=(roll(1,6)+info.monsterattack)
                        info.words=info.words+'\nThey dealt '+str(damage)+' damage!'
                        player.health=player.health-damage
                        info.words=info.words+'\nYour health is at: '+str(player.health)
                    else:
                        info.run=info.run+1
                        info.words=info.words+'\nYou evaded the monster`s attack!'
                        info.b1state='normal'
                        info.b2state='normal'
                        info.b3state='disabled'
            if player.health<=0:
                info.dead=True
                nextclick()
            elif info.run==5:
                info.turn=0
                info.words=info.words+'\nYou have tired the monster out and can run away.'
                info.fight=False
                info.b1state='disabled'
                info.b2state='disabled'
                info.b3state='normal'
            elif info.monsterlife<=0:
                info.exp=info.exp+1
                info.turn=0
                info.words=info.words+'\nYou killed the monster!'
                loot()
                if info.enemy=='dragon':
                    info.win=info.win+1
                info.fight=False
                info.b1state='disabled'
                info.b2state='disabled'
                info.b3state='normal'
        else:
            if info.exp>=3:
                Pass=skillcheck(player.stealth,9+info.day)
                if Pass==False:
                    info.words=info.words+'\nThe dragon hears you, defend yourself!'
                    info.fight=True
                    fightprep()
                elif Pass==True:
                    info.words=info.words+'\nYou sneak into the dragon`s cave and will get a sneak attack on him.'
                    info.fight=False
                    info.exp=info.exp+1
            elif info.terrain=='desert':
                Pass=skillcheck(player.strength,9+info.day)
                if Pass==False:
                    info.words=info.words+'\nYou fell asleep in the desert and withered away without water.'
                    info.dead=True
                elif Pass==True:
                    info.words=info.words+'\nYour rest was just enough to get through the desert quickly you sleep near the edge of it'
                    info.fight=False
                    info.exp=info.exp+1
            elif info.terrain=='forest':
                Pass=skillcheck(player.stealth,9+info.day)
                if Pass==False:
                    info.words=info.words+'\nYou wake the troll and it runs to attack you!.'
                    info.fight=True
                    fightprep()
                elif Pass==True:
                    info.words=info.words+'\nYou sneak past the troll and find your way to the edge of the forest where you camp for the night.'
                    info.fight=False
                    info.exp=info.exp+1
            elif info.terrain=='mountains':
                Pass=skillcheck(player.strength,9+info.day)
                if Pass==False:
                    info.dead=True
                    info.words=info.words+'\nYou ran toward the end of the pass but did not make it before a huge avalanche burried you.'
                elif Pass==True:
                    info.words=info.words+'\nYou run toward the edge of the pass and just barely make it ahead of a huge sideways tsunami of snow fills the pass.'
                    info.exp=info.exp+1
                info.fight=True
                fightprep()
    elif button==0:
        textbox['text']=''
        if info.dead==True:
            with open('highscores.txt','a') as wfh:
                wfh.write('\n'+playername+', score,  '+str(wins)+'\n')
            root.destroy()
        elif info.fight==True:
            info.turn=info.turn+1
            info.b1state='normal'
            info.b2state='normal'
            info.b3state='disabled'
            PlayerArmor=player.armor+5
            if info.monsterlife>0:
                info.words=info.words+'\nIt is the monster`s turn'
                hit=skillcheck(info.monsterattack,PlayerArmor)
                if hit==True:
                    info.words=info.words+'\nThe monster hit you'
                    damage=(roll(1,6)+info.monsterattack)
                    info.words=info.words+'\nThey dealt '+str(damage)+' damage!'
                    player.health=player.health-damage
                    info.words=info.words+'\nYour health is at: '+str(player.health)
                else:
                    info.run=info.run+1
                    info.words=info.words+'\nYou evaded the monster`s attack!'
            if player.health<=0:
                info.dead=True
                nextclick()
            elif info.run==5:
                info.turn=0
                info.words=info.words+'\nYou have tired the monster out and can run away.'
                info.fight=False
                info.b1state='disabled'
                info.b2state='disabled'
                info.b3state='normal'
        elif info.terrain=='mountains':
            Pass=skillcheck(player.sight,9+info.day)
            if Pass==False:
                info.dead=True
                info.words=info.words+'\nYou look around the pass but do not see a huge avalanche in time to escape before it buries you.'
            elif Pass==True:
                info.words=info.words+'\nYou see an avalanche and run in the correct direction to escape before snow fills the pass.'
                info.exp=info.exp+1
            info.fight=True
            fightprep()
        else:
            info.fight=True
            fightprep()
    screenwrite()

def nextclick():
    global textbox
    if info.dead==False:
        info.day=info.day+1
        textbox['text']=''
        info.b1state='normal'
        info.b2state='normal'
        info.b3state='disabled'
        info.terrain=terrainset()
        info.words='you set out into the '+info.terrain
        if info.exp>=3:
            info.words=info.words+'\nYou come to the lair of a dragon \nDo you choose to sneak in or use your powerful thighs to run in full of rage?'
            info.b1words='sneak'
            info.b2words='run in rage'
        elif info.terrain=='desert':
            info.words=info.words+'\nThe sun is very hot, and you are growing tired. \nDo you choose to rest a moment or continue through the desert?'
            info.b1words='rest a moment'
            info.b2words='press on'
        elif info.terrain=='forest':
            info.words=info.words+'\nYou are coming around a corner on the forest path when you spot a troll ahead. \nDo you attack the troll or attempt to sneak past?'
            info.b1words='sneak past'
            info.b2words='attack that Troll'
        elif info.terrain=='mountains':
            info.words=info.words+'\nAs you come to a narrow pass you hear a strange rumbling. \nDo you run towards end of the pass as fast as possible or look around?'
            info.b1words='look around'
            info.b2words='run'
        elif info.terrain=='grasslands':
            spot=skillcheck(player.sight,10)
            if spot==False:
                info.words=info.words+'\nYou are surpised by a tigerbear jumping from the bushes! \nIt kills you.'
                info.dead=True
            elif spot== True:
                info.words=info.words+'\nYou notice a tigerbear attempting to sneak up on you.'
            info.b1words=''
            info.b2words=''
            info.b1state='disabled'
            info.b2state='disabled'
            info.b3state='normal'
            info.fight=True
        elif info.terrain=='marshlands':
            info.words=info.words+'\nThe marshland gives way below you and you find youself neck deep in swamp. \nYou attempt to get ashore.'
            spot=skillcheck(player.strength,10)
            if spot==False:
                info.words=info.words+'\nYou fail to make it to the shore and drown in the swamp.'
                info.dead=True
            elif spot== True:
                info.words=info.words+'\nYou pull yourself ashore with much difficulty. \nYou are wet and gross'
            info.b1words=''
            info.b2words=''
            info.b1state='disabled'
            info.b2state='disabled'
            info.b3state='normal'
            info.fight=True
        elif info.terrain=='hills' or 'windy planes':
            info.words=info.words+'\nYou spend the day travelling on the well worn road'
            info.b1words=''
            info.b2words=''
            info.b1state='disabled'
            info.b2state='disabled'
            info.b3state='normal'
            info.fight=True
        if info.dead==True:
            textbox['text']=''
            info.words='you died. restart or quit?'
            info.b1words='restart'
            info.b2words='quit'
            info.b1state='normal'
            info.b2state='normal'
            info.b3state='disabled'
            info.dead=True
        if info.fight==True:
            fightprep()
    else:
        textbox['text']=''
        info.words='you died. restart or quit?'
        info.b1words='restart'
        info.b2words='quit'
        info.b1state='normal'
        info.b2state='normal'
        info.b3state='disabled'
    screenwrite()
